import TextField from '@mui/material/TextField';

const Register = () => {
  const[formData,setFormData]=useState({
    username:"",
    email:"",
    password:"",
    confirmPassword:""
  })
  return (
    <div>
     <form>
     <TextField id="outlined-basic" label="UserName" variant="outlined" />

     </form>
    </div>
  )
}

export default Register
